import React from "react";
import ThermostatIcon from "@mui/icons-material/Thermostat";
import styles from "../styles/temperatureWidget.module.css";

const TemperatureWidget = ({ temperature }) => {
  return (
    <div className={styles.temperatureWidget}>
      <ThermostatIcon className={styles.temperatureIcon} />
      <div className={styles.temperatureInfo}>
        <h2>Room Temperature</h2>
        <p className={styles.temperatureValue}>
          {temperature !== undefined ? `${temperature}°C` : "Loading..."}
        </p>
      </div>
    </div>
  );
};

export default TemperatureWidget;
